import React from "react";

function Timer() {
  return (
    <div>
      <h1>Focus</h1>
      <hr></hr>
      <div>
        <h1>25:00</h1>
        <button>Start</button>
        <button>Pause</button>
        <button>Reset</button>
      </div>
    </div>
  );
}

export default Timer;
